import React, { PureComponent } from 'react';
import PropTypes from 'prop-types';

export class Icon extends PureComponent {

    render() {
        return (
            <img src={this.props.src}/>
        )
    }
}

Icon.propTypes = {
    epic: PropTypes.bool,
};

export default Icon;
